import React from 'react';
import './Keeper.css';
import keeper1 from '../images/keeper1.jpg';
import keeper2 from '../images/keeper2.jpg';
import keeper3 from '../images/keeper3.jpg';

function Keeper(){
    return (
        <div className="keeper">
           <div className="rowimgk animate__animated animate__zoomIn">
              <div className='colimgk'>
                 <img src={keeper1} alt="img"/>
                 <img src={keeper2} alt="img"/>
              </div>
              <div className='colimgk_'>
                 
              </div>
           </div>
        </div>
    );
}

export default Keeper;
